/*Table structure for table `penandatangan` */

DROP TABLE IF EXISTS `penandatangan`;

CREATE TABLE `penandatangan` (
  `idpenandatangan` char(10) COLLATE utf8mb4_general_ci NOT NULL,
  `nip` char(20) COLLATE utf8mb4_general_ci NOT NULL,
  `namapenandatangan` varchar(100) COLLATE utf8mb4_general_ci NOT NULL,
  `idstruktur` char(2) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `jabatan` varchar(100) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `kdruangan` char(10) COLLATE utf8mb4_general_ci NOT NULL,
  `statusaktif` char(1) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `golongan` varchar(50) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `kdttd` char(2) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `lastupdate` datetime DEFAULT NULL,
  `idpengguna` char(10) COLLATE utf8mb4_general_ci DEFAULT NULL,
  PRIMARY KEY (`idpenandatangan`),
  KEY `kdruangan` (`kdruangan`),
  KEY `idstruktur` (`idstruktur`),
  CONSTRAINT `penandatangan_ibfk_1` FOREIGN KEY (`kdruangan`) REFERENCES `ruangan` (`kdruangan`),
  CONSTRAINT `penandatangan_ibfk_3` FOREIGN KEY (`idstruktur`) REFERENCES `struktur` (`idstruktur`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

