  `sekolahbisalogin` tinyint(1) DEFAULT NULL,
  `uptbisalogin` tinyint(1) DEFAULT NULL,
  `aktifbataspenginputansekolah` tinyint(1) NOT NULL DEFAULT '0'
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

